import React from 'react'
import "./DialogBox.css"
const DialogBox = () => {
  return (
    <div class="dialog-container">
      <h1 style={{ color: "#FFFFFF", textAlign: "center", marginTop: "3%" }}>
        P R O J E C T S
      </h1>

      <a>
        <img
          src={
            "https://cdn.dribbble.com/users/2212397/screenshots/4572319/artboard_5_copy_2x-100.jpg"
          }
          width="100px"
          height="100px"
          style={{marginLeft:"-10%"}}
        />
      </a>
    </div>
  );
}

export default DialogBox
